<body>
<div class="overlay">
  <div class="heart">❤️</div>
  <h1>Dayan</h1>
  <p>
    Desde que llegaste a mi vida todo tiene más sentido.
    Tu sonrisa calma, tu voz abraza y tu amor me hace sentir en casa.
    Este pequeño detalle es solo una forma de decirte que te amo,
    hoy, mañana y siempre.
  </p>
